import React, { useState, useEffect } from 'react';
import { FiHome, FiPieChart, FiUsers, FiSettings, FiMenu } from 'react-icons/fi';

const Dashboard = () => {
  const [isMobile, setIsMobile] = useState(false);
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth <= 992);
    };

    handleResize();
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <div className="dashboard">
      {/* Mobile Menu Button */}
      <button className="menu-toggle" onClick={toggleMenu}>
        <FiMenu />
      </button>

      {/* Overlay for Mobile */}
      <div 
        className={`overlay ${isMenuOpen ? 'active' : ''}`} 
        onClick={toggleMenu}
      />

      {/* Sidebar */}
      <aside className={`sidebar ${isMenuOpen ? 'active' : ''}`}>
        <div className="logo-section">
          <div className="logo">
            <span>D</span>
          </div>
          <h1>Dashboard</h1>
        </div>

        <div className="sidebar-header">
          <h2>Main Menu</h2>
        </div>

        <nav>
          <ul>
            <li>
              <a href="#" className="active">
                <span className="icon"><FiHome /></span>
                <span className="text">Dashboard</span>
              </a>
            </li>
            <li>
              <a href="#">
                <span className="icon"><FiPieChart /></span>
                <span className="text">Analytics</span>
              </a>
            </li>
            <li>
              <a href="#">
                <span className="icon"><FiUsers /></span>
                <span className="text">Users</span>
              </a>
            </li>
            <li>
              <a href="#">
                <span className="icon"><FiSettings /></span>
                <span className="text">Settings</span>
              </a>
            </li>
          </ul>
        </nav>

        <div className="sidebar-footer">
          <div className="user-profile">
            <div className="avatar">JD</div>
            <div className="user-info">
              <span className="name">John Doe</span>
              <span className="role">Admin</span>
            </div>
          </div>
        </div>
      </aside>

      {/* Main Content */}
      <main className="content">
        <h2>Welcome to Dashboard</h2>
        <p>This is the main content area. Resize the browser to see the responsive behavior.</p>
      </main>
    </div>
  );
};

export default Dashboard;
